description:
The debut album from the renowned German production team, Snowgoons, German Lugers reflects the continually growing international penetration of and respect for hip-hop music and culture. Boasting a veritable who's who of independent hip-hop players and elite including Sean Price, Afu Ra, Jus Allah, Reef The Lost Cauze, Chief Kamachi, Craig G., El DA Sense, Wordsworth, Rasco &amp; many more. The CD showcases the stylistic breadth of Germany's bubbling production team paired with the best of today's established and up &amp; coming independent emcees.

